import React from 'react';
import './App.scss';
import './About'
import './Contact'
import './Main'

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Main from './Main';
import contact from './Contact';



class App extends React.Component {

  render() {

    return (

      <Router>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/contact">
            <Contact />
          </Route>
          <Route path="/">
             <Main></Main>
          </Route>
        </Switch>

      </Router>
    );
  }

}


export default App;
